import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { Link } from 'react-router-dom';

function NavBar() {
    const foodNames = [
        "grilled cheese sandwich",
        "chicken parmesan",
        "spaghetti and meatballs",
        "beef stroganoff",
        "taco salad",
        "vegetable stir-fry",
        "teriyaki salmon",
        "caesar salad",
        "chicken alfredo",
        "beef tacos",
        "lasagna",
        "chicken fajitas",
        "pork chops",
        "macaroni and cheese",
        "beef and broccoli",
        "vegetable soup",
        "shrimp scampi",
        "pad thai",
        "chicken curry",
        "beef burritos"
      ]
      


    async function getFoodDetails(foodNames) {
        // Search for foods by name
        const searchResponse = await fetch(`https://api.nal.usda.gov/fdc/v1/foods/search?api_key=DEMO_KEY&query=${foodNames.join(',')}`)
        const searchResults = await searchResponse.json()

        // Get FDC IDs of matching foods
        const fdcIds = searchResults.foods.map(food => food.fdcId)

        // Retrieve details and images for each food item
        const foodDetailsPromises = fdcIds.map(async fdcId => {
            const response = await fetch(`https://api.nal.usda.gov/fdc/v1/food/${fdcId}?api_key=DEMO_KEY&nutrients=true`)
            const data = await response.json()
            return data
        })

        const foodDetails = await Promise.all(foodDetailsPromises)

        // Extract images from food details
        const images = foodDetails.map(food => food.foodNutrients.find(nutrient => nutrient.nutrientName === "Image").value)

        console.log(images)
    }

    getFoodDetails()
    return (
        <Navbar bg="light" variant="light">
            <Container>
                <Navbar.Brand href="#home">Navbar</Navbar.Brand>
                <Nav className="me-auto">
                    {/* <Link to={"/"} ></Link>
                    <Link to={"/"} >Features</Link>
                    <Link to={"/"} >Pricing</Link> */}
                </Nav>
            </Container>
        </Navbar>
    );
}

export default NavBar;
